import { Box, Typography, Button } from "@mui/material";
import { motion } from "framer-motion";

export default function Hero() {
  return (
    <Box sx={{
      height: "90vh",
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
      background: "linear-gradient(135deg,#2196f3,#00e5ff)",
      color: "white"
    }}>
      <motion.div initial={{ scale: 0 }} animate={{ scale: 1 }}>
        <Typography variant="h2">PhysioTattva</Typography>
        <Typography variant="h6">Healing through movement</Typography>
        <Button variant="contained" sx={{ mt: 2 }}>Book Appointment</Button>
      </motion.div>
    </Box>
  );
}
